      <script type="text/javascript">
        $(document).ready(function () {
          var prepareForInfineonSsoLogin = function () {
            $("#btn-sso").removeClass("btn-light").addClass("btn-primary");
            $("#btn-form-no-company")
              .removeClass("btn-primary")
              .addClass("btn-light");
            $("#btn-form-no-employeeId")
              .removeClass("btn-primary")
              .addClass("btn-light");
            $("#form-container").addClass("display-none");
          };
          var prepareForInfineonLogin = function () {
            $("#btn-form-no-company")
              .removeClass("btn-light")
              .addClass("btn-primary");
            $("#btn-sso").removeClass("btn-primary").addClass("btn-light");
            $("#btn-form-no-employeeId")
              .removeClass("btn-primary")
              .addClass("btn-light");

            $("#form-container").removeClass("display-none");
            $("#ipt-employeeId").removeClass("display-none");
            $("#ipt-department").removeClass("display-none");
            $("#ipt-company").addClass("display-none");
          };
          var prepareForVisitorLogin = function () {
            $("#btn-form-no-employeeId")
              .removeClass("btn-light")
              .addClass("btn-primary");
            $("#btn-sso").removeClass("btn-primary").addClass("btn-light");
            $("#btn-form-no-company")
              .removeClass("btn-primary")
              .addClass("btn-light");

            $("#form-container").removeClass("display-none");
            $("#ipt-company").removeClass("display-none");
            $("#ipt-department").addClass("display-none");
            $("#ipt-employeeId").addClass("display-none");
          };

          var activeForm = localStorage.getItem("activeForm");
          if (activeForm && activeForm === "Infineon SSO Login") {
            prepareForInfineonSsoLogin();
          } else if (activeForm && activeForm === "Infineon Login") {
            prepareForInfineonLogin();
          } else if (activeForm && activeForm === "Visitor Login") {
            prepareForVisitorLogin();
          }

          $("#btn-form-no-company").click(function () {
            localStorage.setItem("activeForm", "Infineon Login");
            prepareForInfineonLogin();
          });

          $("#btn-form-no-employeeId").click(function () {
            localStorage.setItem("activeForm", "Visitor Login");
            prepareForVisitorLogin();
          });

          $("#btn-sso").click(function () {
            localStorage.setItem("activeForm", "Infineon SSO Login");
            prepareForInfineonSsoLogin();
          });
        });
      </script>
